import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import UserList from './components/UserList';
import PatientList from './components/PatientList';
import MainPage from './components/MainPage'; // Aggiungi il componente per la Main Page se necessario
import Login from './components/Login'; // Aggiungi il componente per il Login se necessario
import { AuthProvider } from './contexts/AuthContext';
import HamburgerMenu from './components/HamburgerMenu';

function App() {
  return (
    <AuthProvider>
      <Router>
        <HamburgerMenu />
        <Routes>
          <Route path="/main" element={<MainPage />} />
          <Route path="/users" element={<UserList />} />
          <Route path="/patients" element={<PatientList />} />
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<MainPage />} /> {/* Aggiungi una rotta predefinita */}
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
